import React from 'react';
import FoodList from './src/foodList';
import { Provider } from 'react-redux';
import configureStore from './src/store';

const store = configureStore();
const App = () =>(

  <Provider store={store}>

  <FoodList/>
  </Provider>
  )
  export default App
